INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("カリン", 2, 1, 1, -416.5, "2025/01/31 12:00:00", "2030/01/01 14:59:59", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 1, 62, 0.0, 3.414, 190804, 1000001);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("カリン", 2, 2, 1, -416.5, "2025/01/31 12:00:00", "2030/01/01 14:59:59", "ミッションをクリアして、\n報酬をゲットしましょう！", 1, 62, 0.0, 3.099, 190804, 1000002);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("カリン", 2, 3, 1, -416.5, "2025/01/31 12:00:00", "2030/01/01 14:59:59", "受け取ることができる\n報酬があるようです\n確認してみてください", 1, 63, 0.0, 2.801, 190804, 1000003);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("カリン", 2, 4, 1, -416.5, "2025/01/31 12:00:00", "2030/01/01 14:59:59", "報酬がもらえますよ！\nチェックしてみてください", 2, 63, 0.0, 0.0, 190804, 1000004);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("カリン", 1, 5, 1, -363.0, "2025/01/31 12:00:00", "2030/01/01 14:59:59", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 2, 64, 0.0, 2.12, 190804, 1000005);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("カリン", 2, 6, 1, -363.0, "2025/01/31 12:00:00", "2030/01/01 14:59:59", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 1, 64, 0.0, 1.68, 190804, 1000006);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("カリン", 1, 7, 1, -363.0, "2025/01/31 12:00:00", "2030/01/01 14:59:59", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 2, 64, 0.0, 2.33, 190804, 1000007);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ラビリスタ", 7, 101, 10201, -285.0, "2025/01/31 12:00:00", "2030/01/01 14:59:59", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 3, 61, -6.0, 5.18, 133701, 1020101);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("クリスティーナ", 2, 201, 10201, -285.0, "2025/01/31 12:00:00", "2030/01/01 14:59:59", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 1, 61, -2.0, 8.77, 133901, 1020102);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ネネカ", 1, 301, 10201, -285.0, "2025/01/31 12:00:00", "2030/01/01 14:59:59", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 6, 61, 0.0, 15.5, 133801, 1020103);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ランファ", 5, 101, 10202, -285.0, "2025/02/28 12:00:00", "2030/01/01 14:59:59", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 2, 61, 0.0, 9.061, 134301, 1020201);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("チカ", 2, 201, 10202, -285.0, "2025/02/28 12:00:00", "2030/01/01 14:59:59", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 1, 61, 0.0, 7.699, 134401, 1020202);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("アオイ", 2, 101, 10203, -285.0, "2025/03/31 12:00:00", "2030/01/01 14:59:59", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 1, 61, 0.0, 8.595, 134601, 1020301);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("クローチェ", 2, 201, 10203, -285.0, "2025/03/31 12:00:00", "2030/01/01 14:59:59", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 1, 61, 0.0, 7.758, 134501, 1020302);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ルイズマリー", 6, 101, 10204, -285.0, "2025/04/30 12:00:00", "2030/01/01 14:59:59", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 2, 61, 0.0, 7.0, 132302, 1020401);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("イロハ", 2, 201, 10204, -285.0, "2025/04/30 12:00:00", "2030/01/01 14:59:59", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 1, 61, 0.0, 7.904, 132402, 1020402);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ソノ", 2, 301, 10204, -285.0, "2025/04/30 12:00:00", "2030/01/01 14:59:59", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 4, 61, 0.0, 8.487, 132502, 1020403);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("カノン", 2, 101, 10205, -285.0, "2025/05/31 12:00:00", "2030/01/01 14:59:59", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 1, 61, 0.0, 8.763, 134901, 1020502);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ツムギ", 3, 201, 10205, -285.0, "2025/05/31 12:00:00", "2030/01/01 14:59:59", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 1, 61, 0.0, 6.417, 134801, 1020503);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("エリス", 7, 101, 10206, -285.0, "2025/06/30 12:00:00", "2030/01/01 14:59:59", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 3, 61, 0.0, 10.335, 135001, 1020601);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("シェフィ", 4, 201, 10206, -285.0, "2025/06/30 12:00:00", "2030/01/01 14:59:59", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 2, 61, 0.0, 6.281, 135101, 1020602);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("プレシア", 2, 301, 10206, -285.0, "2025/06/30 12:00:00", "2030/01/01 14:59:59", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 1, 61, 0.0, 12.244, 135201, 1020603);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("クリア", 8, 101, 10207, -285.0, "2025/07/31 12:00:00", "2030/01/01 14:59:59", "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 2, 61, 0.0, 6.339, 135301, 1020701);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("アネモネ", 9, 201, 10207, -285.0, "2025/07/31 12:00:00", "2030/01/01 14:59:59", "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 7, 61, 0.0, 8.184, 135401, 1020702);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("アイラ", 2, 101, 10208, -285.0, "2025/08/31 12:00:00", "2030/01/01 14:59:59", "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 9, 61, 0.0, 3.906, 129101, 1020801);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("シナツ", 2, 201, 10208, -285.0, "2025/08/31 12:00:00", "2030/01/01 14:59:59", "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 1, 61, 0.0, 14.465, 129201, 1020802);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ヒヨリ", 3, 301, 10208, -285.0, "2025/08/31 12:00:00", "2030/01/01 14:59:59", "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 4, 61, 0.0, 8.662, 100101, 1020803);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("レイ", 3, 401, 10208, -285.0, "2025/08/31 12:00:00", "2030/01/01 14:59:59", "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 1, 61, 0.0, 10.915, 100301, 1020804);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ユキノ", 7, 101, 10209, -285.0, "2025/09/30 12:00:00", "2030/01/01 14:59:59", "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 1, 61, 0.0, 6.042, 135802, 1020901);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("サツキ", 1, 201, 10209, -285.0, "2025/09/30 12:00:00", "2030/01/01 14:59:59", "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 4, 61, 0.0, 9.402, 135903, 1020902);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ルルィ", 1, 301, 10209, -285.0, "2025/09/30 12:00:00", "2030/01/01 14:59:59", "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 8, 61, 0.0, 8.16, 136902, 1020903);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("カスミ", 2, 101, 10210, -285.0, "2025/10/31 12:00:00", "2030/01/01 14:59:59", "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 3, 61, 0.0, 5.0, 137401, 1021001);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("アラクネ", 1, 201, 10210, -285.0, "2025/10/31 12:00:00", "2030/01/01 14:59:59", "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 4, 61, 0.0, 8.12, 136001, 1021002);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ナーナ", 2, 301, 10210, -285.0, "2025/10/31 12:00:00", "2030/01/01 14:59:59", "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 4, 61, 0.0, 6.386, 136202, 1021003);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ユイ", 4, 101, 10211, -285.0, "2025/11/30 12:00:00", "2030/01/01 14:59:59", "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 3, 61, 0.0, 7.438, 136402, 1021101);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ミソラ", 5, 201, 10211, -285.0, "2025/11/30 12:00:00", "2030/01/01 14:59:59", "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 1, 61, 0.0, 8.35, 136302, 1021102);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("シズル", 2, 101, 10212, -285.0, "2025/12/31 12:00:00", "2030/01/01 14:59:59", "新しい年がやってくるね！\nお正月の料理も飾りつけも、\nお姉ちゃんにお任せだよ♪\nみんなで楽しく新年を迎えよう！", 1, 61, 0.0, 5.0, 136501, 1021201);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("リノ", 2, 201, 10212, -285.0, "2025/12/31 12:00:00", "2030/01/01 14:59:59", "おうちの掃除もトラブルも、 \n世界を揺るがす大ピンチも！\n今年のことは今年のうちに \nサッサと片付けちゃいますっ！", 1, 61, 0.0, 5.25, 137902, 1021202);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES ("ラビリスタ", 2, 301, 10212, -285.0, "2025/12/31 12:00:00", "2030/01/01 14:59:59", "年の瀬はギルドマスターも\nつい駆け回っちゃう忙しい時期だ！\n一年いろいろあったけど\nお互いイイ年を迎えよう、少年！", 1, 61, 0.0, 7.5, 106801, 1021203);
